INSERT INTO `v9_fyal` VALUES('383','116','0','头发种植案例','','http://bjshenniao.zhifa.cc/uploadfile/2015/0326/20150326013543359.jpg','头发 案例','自从上海师范大学毕业后我就回到贵阳一所学校教书，深得学生们的喜欢与支持。然而自己心中有件事却开心不起来，因为在第二个学期的期末考试过后，突然发现自己的头发掉得很厉害！\r\n\r\n如今前额部位的头发已经非常稀疏了，稀疏的都可以看到头皮了，两个额角已经有明显的后退趋势，看到这个甚是担忧。\r\n\r\n我一想到自己中年就开始谢顶的父亲，深深的恐惧顿时攫住了他的心。于是我开始积极的寻求解决之道，那段时间经常用百度来进行搜索。一开始搜索出来的结果基本上都不是我所需要的，在浪费了大量的时间之后，总算找到了头绪，搜索出来的信息也开始对症了。\r\n\r\n经过了很长一段时间的学习，我准备尝试一下广告做得比较火爆的XX防脱洗发水和YY生发液，虽然内心里对电视上那夸张的效果不是很信任，但是出于对脱发的恐惧和对头发的渴望，我还是花了大把的银子。试用了半年之后，悲哀的发现，防脱洗发水和生发液虽然暂时性控制住了脱发，但是缺发部位的头发并没有有效生长出来。\r\n\r\n2013年的春节长假，我在论坛上遇到一个做完植发手术发帖展示的网友，在和对方聊了很长时间之后，终于开始正视起前几年曾经被他判定为“骗人把戏”的植发手术来。','0','http://bjshenniao.zhifa.cc/bjfyal_tfzz/0326_383.html','0','99','1','0','xuxiaobo','1427347947','1427348184');
INSERT INTO `v9_fyal` VALUES('384','117','0','眉毛种植案例','','http://bjshenniao.zhifa.cc/uploadfile/2015/0326/20150326014034823.jpg','眉毛 案例','28岁的韩小姐是南航的一名空姐，高挑的她看上去非常的漂亮、大方，由于从事航空服务工作，经常要为各式各样的商务白领人士提供服务，为了不让自己的稀疏的眉毛影响了自己的综合形象，也为了不用每天不断的画眉，追求自然而不造作的眉毛，韩小姐四处打听纹眉、植眉的相关事项。\r\n\r\n长相出众、身材完美、具有亲和力这是韩小姐在工作中具有的绝佳优势，然而，由于眉毛稀疏，让她不得不频繁的画眉、修眉，给她带来一定的烦恼。考虑到工作的特殊性，为了不让眉毛影响到自身的整体形象，对自身要求比较高的她在朋友的推荐下，选择了植眉手术。最终韩小姐在好姐妹的陪同下走进了雍禾植发。\r\n​\r\n韩小姐通过网络免费预约平台，在雍禾植发进行免费预约挂号。她咨询了眉毛移植的专家，通过详细的咨询后，韩小姐最终选择UHE微米级无痕植眉技术进行眉毛移植。植发手术医生根据韩小姐的脸型为其设计了眉形，通过3个小时的手术，植发医生采用UHE微米级无痕植眉技术为其进行眉毛移植。','0','http://bjshenniao.zhifa.cc/bjfyal_mmzz/0326_384.html','0','99','1','0','xuxiaobo','1427348302','1427348458');
INSERT INTO `v9_fyal` VALUES('385','118','0','睫毛种植案例','','','睫毛 案例','从小我的睫毛就短小稀少，还有倒睫的问题。这让眼睛小，又懒得化妆的我很苦恼。人不都说眼睛是心灵的窗户么？可为什么我的眼睛就不能那么明亮动人，睫毛忽闪忽闪的美丽可爱呢？长大以后，我就开始学习化妆。睫毛膏是我最爱的单品。每次都要浓密、纤长好几支拼命地涂，特殊的场合还要借助于假睫毛的帮忙。虽然，化妆后的我也变的睫毛弯弯。但是总是觉得很麻烦，治标不治本。我还是想拥有浓密纤长的睫毛。”\r\n\r\n一次无意听朋友说睫毛可以种植，自己处于好奇就开始从网上查询睫毛种植的相关事宜，大致了解后，决定自己也要种植睫毛，让自己也拥有一双明媚的大眼睛。\r\n\r\n于是在周末拉着好友陪我走进了雍禾植发医院。经过和专业医生沟通后，了解到睫毛短小稀少的问题唯一有效的解决办法就是进行睫毛移植手术。医生对我进行专业检测后采用UHE微米级无痕睫毛种植手术，提取自身后枕部健康的毛囊移植到眼睫部位，两侧共植入90根。UHE微米级无痕植睫毛手术是目前用于毛发移植最先进的技术，手术全程无痛不开刀，移植部位和取发部位没有任何疤痕，完全不会影响正常的工作生活。','0','http://bjshenniao.zhifa.cc/bjfyal_jmzz/0326_385.html','0','99','1','0','xuxiaobo','1427348501','1427348576');
INSERT INTO `v9_fyal` VALUES('386','120','0','发际线调整案例','','http://bjshenniao.zhifa.cc/uploadfile/2015/0326/20150326014835713.jpg','发际 案例','张先生数年前还着披着一头茂密乌黑的头发穿梭于大街小巷时，虽未引起明显的回头，但感觉清新自然。那时根本张先生就没有想过自己会有一天因为头发而如此烦恼。也许真的是失去后才懂得珍惜，这几年张先生对着镜子看着自己的前额逐渐上移、头发渐渐稀少时，才懊悔不已。张先生“头发的离去，是风的追求?还是头皮的不挽留?”\r\n\r\n自从发现自己头发已经开始脱落，张先生就四处求医，想尽一切办法来解决，可是所有的偏方、药物都试过了，头发仍然疯狂的脱落。当从网上了解到脱发严重的原因后，张先生不禁感慨：如果这些年早些注意，少熬夜、注意保养应该也不会出现这种情况。头发的悄然离去，让张新生悔恨有加，这些年我怎么就变成这样了呢？\r\n​\r\n脱发确实是一件很郁闷的事，整体看起来感觉衰老、不健康。和朋友、同事在一起的时候，会多少损失了一些自信。\r\n \r\n为了挽救失落的心，张先生到处寻找治疗脱发的方法和医院，前前后后也用子许多药物，但效果并不明显。据张先生介绍说，是2010年8月的某一天，他突然在网站上收到了雍禾植发植发中心的网站上面还有一些植发前后对比的照片，不过“植发”这词着实吸引了张先生，后来张先生立刻利用网络搜索各种相关信息。那时才知道，植发手术确实是存在的。','0','http://bjshenniao.zhifa.cc/bjfyal_fjxtz/0326_386.html','0','99','1','0','xuxiaobo','1427348768','1427348921');
INSERT INTO `v9_fyal` VALUES('387','121','0','疤痕种植案例','','http://bjshenniao.zhifa.cc/uploadfile/2015/0326/20150326015219283.jpg','疤痕 案例','我是一名刚上大学的学生，在别人眼中，我的大好前程刚刚开始，美好的大学校园生活也即将展开，可是在风光的大学生活，却让我高兴不起来。因为我天天都要带着假发混日子，想到大学和同学一个宿舍，就有点烦恼，更难以想象到时如果真的他们拿着我的假发开玩笑，我该怎么办？\r\n\r\n小时候不小心从屋顶摔了下来，脑袋上磕了一个很大的疤，当时的疼痛已经忘记，不过那个疤却一直留了下来，因为这个疤，头发在这个地方就从此绝迹了，看着别人的头上郁郁葱葱，我真的很少羡慕，不过又能怎样呢？当时能捡回一条命已经算是很幸运了。\r\n\r\n从小我就和帽子相伴，妈妈给我买了很多顶很漂亮的帽子，不过帽子有时候也很难看，有时候我真的很想直接将帽子全部扔了，可是为了避免别人异样的眼光我最后还是选择了沉默，一直到我长大我就开始了自己与假发一起的日子，刚开始只能买很便宜的假发，哪种假发的质量很差劲，有时候甚至会掉头发，而且假发很不方便，在夏天会很闷热，而且一般假发都会有一定的长度，自己每天不得不顶个香菇头。','0','http://bjshenniao.zhifa.cc/bjfyal_bhzf/0326_387.html','0','99','1','0','xuxiaobo','1427349059','1427349150');
INSERT INTO `v9_fyal` VALUES('388','122','0','胡须种植案例','','http://bjshenniao.zhifa.cc/uploadfile/2015/0326/20150326015450597.jpg','胡须 案例','我是客户部总监，经常在外和我们公司的客户洽谈，形象是给人的第一印象，特别的重要。以前我不管多忙也要刮胡子，因为胡子一旦长出来，不仅没型、凌乱，还显得颓废脏兮兮的，总是给忙碌的工作和生活带来多重困扰。常常看男人装这些时尚杂志，看人家模特的胡子型真是羡慕不已，真的很man，其实在心里就一直想做胡须移植手术。\r\n\r\n去年公司年会恰巧遇到了以前的合作伙伴。哇，他看起来比以前看上去稚嫩的形象真是不一样了，特有男人的那股味道。和他谈话中我得知他进行了胡须移植手术很成功。现在的气质和形象都有赖于好的手术医生的技术和设计。\r\n\r\n于是，在他的推荐下，我来到了雍禾植发，带着新奇的心情和对胡须的渴望，我仔细咨询了这里的植发专家，她们也很耐心的给我一一解答。此时此刻，我将所以的依赖和信任都交给了雍禾植发。\r\n\r\n植发专家对我的脸型和毛发质量进行了全面综合的考虑和检测后，为我设计了一款我很满意的胡须造型，让我对着镜子看是否满意。当时只是画出来的痕迹，我说现在具体还看不出来，就按这个胡须造型种植就行。在征得我的同意后，才开始进行手术，整个过程一点痛苦没有，几周后我蓄起了胡须，不仅服帖整齐，还很有型!现在工作交流，给别人留下的印象十分好。我自己也信心十足有面子。','0','http://bjshenniao.zhifa.cc/bjfyal_hxzz/0326_388.html','0','99','1','0','xuxiaobo','1427349208','1427349295');
INSERT INTO `v9_fyal` VALUES('389','123','0','鬓角种植案例','','http://bjshenniao.zhifa.cc/uploadfile/2015/0326/20150326015753265.jpg','鬓角 案例','我今年27岁，刚刚大学毕业不到两年，在校时是一名优秀的学生，毕业后便顺利的进入一家知名度很高的大企业工作。但是工作期间却面临诸多尴尬。因为我是一位先天性鬓角缺失患者，导致原本凸起的颧骨更加的凸显，严重影响了面部的整体美感。虽然这不是什么大病，但非常重影响面部轮廓。公司有几次与客户谈判，经理都 \"特意 \"没有让我参加。\r\n\r\n我知道自己已经步入社会，不像在校园，什么都无所谓，整天把自己埋在图书馆，不怎么注意自己的外形。这次我对经理没有一点儿抱怨，问题出现在我自己身上，自己的问题就要自己解决。\r\n​\r\n通过多方的了解和咨询，后来听说雍禾植发的植发技术项目包括鬓角种植，且效果很好，便利用周末的时间赶了过来。植发专家肯定的告诉我，我的鬓角完全可以种植，雍禾植发还让他们院里的人体美学设计师根据我的脸型和当前的鬓角状态为他进行了鬓角术前设计，设计中多次征求我个人的意见，制定了更系统的植发手术方案。最终植发专家采用FUE-APL2 0无痕植发技术为我进行植发，从毛囊提取、分离毛囊、种植毛囊，整个过程一气呵成，非常顺利。','0','http://bjshenniao.zhifa.cc/bjfyal_bjzz/0326_389.html','0','99','1','0','xuxiaobo','1427349494','1427349532');
INSERT INTO `v9_fyal` VALUES('390','124','0','美人尖种植案例','','http://bjshenniao.zhifa.cc/uploadfile/2015/0326/20150326021239179.jpg','美人 案例','最先知道女士美人尖这词是缘于一位大学同学，撸上她的留海长发，便能看见额上中部头发尖尖地突出，真如鸟喙。我的这位同学亦的确长得美，大大的眼睛，长长的睫毛，柳叶眉，俏鼻红唇，还有这美人尖，再加上柔柔的声音，男女都为之倾倒。于是，我在艳羡之余，便想：美人大抵都有这样一个美人尖，这尖也是万平从中的一点尖了，百里挑一。放眼望去，一眼明晰美女所在，便如在众里寻她千百度，蓦然回首的一刹那的意境。\r\n\r\n标准的美女是不能没有美人尖的，尤其是夏天，当你把刘海后梳，露出光滑的额头时，过于平整的发际线，会使整个人显得没有生气，缺乏立体感。而美人尖，就是很好的“破除”单调发际线的点睛之笔。\r\n\r\n毕业以后工作了，如今身边美女如云，甚是羡慕，为了将自己打造成美女我也从各方面开始着手。一次听朋友说可以种植美人尖，心里痒痒的，工作几年了也稍有积蓄,为自己的塑美行动开始准备。听朋友推荐雍禾植发FUE-APL2 0是一项国际流行的毛发移植项目。雍禾植发医生会帮你在发际线中部，按照黄金比例和“三庭五眼”种出一个小小的三角，瞬间提升额头乃至整个面部的立体感，使人充满生气，让那些没有美人尖的“准美女”们，迅速拥有属于自己的美人尖。','0','http://bjshenniao.zhifa.cc/bjfyal_mrjzz/0326_390.html','0','99','1','0','xuxiaobo','1427350290','1427350365');
INSERT INTO `v9_fyal` VALUES('391','125','0','女性植发案例','','http://bjshenniao.zhifa.cc/uploadfile/2015/0326/20150326023016911.jpg','植发 案例 女性','上海的刘女士在当地一家星级酒店担任大堂经理，自从懂得辨别美丑之后，她从未扎过辫子，不管留短发还是留长发，她都喜欢用长长的刘海挡住自己那略显空旷的额头。为何刘女士从不梳马尾呢？原来她是属于那种天生发际线比较高的人。\r\n\r\n　　然而有一天风云突变，酒店来了一副喜欢较真的李总，在看到刘女士之后立刻就皱起了眉头。\r\n\r\n　　“李总说我的样子看起来一点也不够职业，不像大堂经理，倒像个酒吧里驻唱的。说真的，当时我一听他这么说，差点儿就哭出来了！”刘女士回忆说，由于新来的李总要求留长头发的女性员工需要将自己的头发扎起来系在脑后，否则就要扣工资扣奖金，所以当时她非常的纠结。\r\n\r\n　　一方面，她舍不得留了好多年的长头发，另一方面，她又舍不得薪水不菲的工作。想保留头发，就要面临被扣工资扣奖金的局面，那样不但会损失钱财，还会很丢人，因为所有被扣钱的员工是会被通报批评的，想避免这种情况，要么按要求把头发扎起来，要么直接剪成短发，要么……就辞职走人。','0','http://bjshenniao.zhifa.cc/bjfyal_nxzf/0326_391.html','0','99','1','0','xuxiaobo','1427351348','1427351421');
