INSERT INTO `v9_fyal_data` VALUES('383','自从上海师范大学毕业后我就回到贵阳一所学校教书，深得学生们的喜欢与支持。然而自己心中有件事却开心不起来，因为在第二个学期的期末考试过后，突然发现自己的头发掉得很厉害！<br />\r\n<br />\r\n如今前额部位的头发已经非常稀疏了，稀疏的都可以看到头皮了，两个额角已经有明显的后退趋势，看到这个甚是担忧。<br />\r\n<br />\r\n我一想到自己中年就开始谢顶的父亲，深深的恐惧顿时攫住了他的心。于是我开始积极的寻求解决之道，那段时间经常用百度来进行搜索。一开始搜索出来的结果基本上都不是我所需要的，在浪费了大量的时间之后，总算找到了头绪，搜索出来的信息也开始对症了。<br />\r\n<br />\r\n经过了很长一段时间的学习，我准备尝试一下广告做得比较火爆的XX防脱洗发水和YY生发液，虽然内心里对电视上那夸张的效果不是很信任，但是出于对脱发的恐惧和对头发的渴望，我还是花了大把的银子。试用了半年之后，悲哀的发现，防脱洗发水和生发液虽然暂时性控制住了脱发，但是缺发部位的头发并没有有效生长出来。<br />\r\n<br />\r\n2013年的春节长假，我在论坛上遇到一个做完植发手术发帖展示的网友，在和对方聊了很长时间之后，终于开始正视起前几年曾经被他判定为&ldquo;骗人把戏&rdquo;的植发手术来。<br />\r\n<br />\r\n最早听说植发手术的时候，我下意识的就把它当成了骗人的把戏，我一直觉得，头发这东西怎么可能通过种植而长出来？又不是地里的花花草草，怎么样也不可能实现啊！谈到当初的误解，自己脸上有点不好意思啦。我发现有好多和我一样的人，都是在试过了防脱生发产品和药物治疗没有得到满意结果的情况下才会抱着试试看的态度来接触植发手术，现在想想，真的是有点不撞南墙不回头的感觉！<br />\r\n<br />\r\n2013年5月1日，我走近了上海雍禾植发毛发移植室，选择FUE-APL2.0无痕植发技术，移植1600个毛囊单位。在不安和期盼中，时间飞快的过去了，差不多一年时间，我惊喜的发现自己原来非常稀疏的头发变浓密了，缺发的前额部位也已经长出新的头发，如今感到特别高兴，工作起来也特别有激情！<br />\r\n<br />\r\n&nbsp;看，是不是我植发前后对比差别很大。<br />\r\n','0','','0','10000','','0','1','','http://bjshenniao.zhifa.cc/uploadfile/2015/0326/20150326013313930.jpg','http://bjshenniao.zhifa.cc/uploadfile/2015/0326/20150326013321564.jpg','http://bjshenniao.zhifa.cc/uploadfile/2015/0326/20150326013327219.jpg','林先生 ');
INSERT INTO `v9_fyal_data` VALUES('384','28岁的韩小姐是南航的一名空姐，高挑的她看上去非常的漂亮、大方，由于从事航空服务工作，经常要为各式各样的商务白领人士提供服务，为了不让自己的稀疏的眉毛影响了自己的综合形象，也为了不用每天不断的画眉，追求自然而不造作的眉毛，韩小姐四处打听纹眉、植眉的相关事项。<br />\r\n<br />\r\n长相出众、身材完美、具有亲和力这是韩小姐在工作中具有的绝佳优势，然而，由于眉毛稀疏，让她不得不频繁的画眉、修眉，给她带来一定的烦恼。考虑到工作的特殊性，为了不让眉毛影响到自身的整体形象，对自身要求比较高的她在朋友的推荐下，选择了植眉手术。最终韩小姐在好姐妹的陪同下走进了雍禾植发。<br />\r\n<br />\r\n韩小姐通过网络免费预约平台，在雍禾植发进行免费预约挂号。她咨询了眉毛移植的专家，通过详细的咨询后，韩小姐最终选择UHE微米级无痕植眉技术进行眉毛移植。植发手术医生根据韩小姐的脸型为其设计了眉形，通过3个小时的手术，植发医生采用UHE微米级无痕植眉技术为其进行眉毛移植。<br />\r\n&nbsp;<br />\r\n植发手术后，韩小姐根据植发医生的建议和指导进行术后的眉毛护理，通过一年左右的跟踪随访，韩小姐告诉植发专家，自己的眉毛已经完全长出来了，并且和手术前设计的眉形是一致的，姐妹都说她的眉毛移植的非常漂亮，拥有了完美自然的眉型，让韩小姐更加自信，每天面带微笑，碰到想咨询眉毛的问题，韩小姐总是高兴地推荐选雍禾植发吧，你看我的眉毛好看吗？就是在那里做的。<br />\r\n','0','','0','10000','','0','1','','http://bjshenniao.zhifa.cc/uploadfile/2015/0326/20150326013940685.jpg','http://bjshenniao.zhifa.cc/uploadfile/2015/0326/20150326013946847.jpg','http://bjshenniao.zhifa.cc/uploadfile/2015/0326/20150326013953394.jpg','韩小姐');
INSERT INTO `v9_fyal_data` VALUES('385','从小我的睫毛就短小稀少，还有倒睫的问题。这让眼睛小，又懒得化妆的我很苦恼。人不都说眼睛是心灵的窗户么？可为什么我的眼睛就不能那么明亮动人，睫毛忽闪忽闪的美丽可爱呢？长大以后，我就开始学习化妆。睫毛膏是我最爱的单品。每次都要浓密、纤长好几支拼命地涂，特殊的场合还要借助于假睫毛的帮忙。虽然，化妆后的我也变的睫毛弯弯。但是总是觉得很麻烦，治标不治本。我还是想拥有浓密纤长的睫毛。&rdquo;<br />\r\n<br />\r\n一次无意听朋友说睫毛可以种植，自己处于好奇就开始从网上查询睫毛种植的相关事宜，大致了解后，决定自己也要种植睫毛，让自己也拥有一双明媚的大眼睛。<br />\r\n<br />\r\n于是在周末拉着好友陪我走进了雍禾植发医院。经过和专业医生沟通后，了解到睫毛短小稀少的问题唯一有效的解决办法就是进行睫毛移植手术。医生对我进行专业检测后采用UHE微米级无痕睫毛种植手术，提取自身后枕部健康的毛囊移植到眼睫部位，两侧共植入90根。UHE微米级无痕植睫毛手术是目前用于毛发移植最先进的技术，手术全程无痛不开刀，移植部位和取发部位没有任何疤痕，完全不会影响正常的工作生活。<br />\r\n<br />\r\n术后三个月，我的睫毛伴随着新长出来的睫毛明媚闪耀了起来。真开心！她终于可以自信的不化妆出门了！她现在真的很开心，只通过一个小手术，就一下子让我有了大改变！希望有同样困惑的姐妹们也能和我一样，早日打跑爱美路上的拦路虎。<br />\r\n','0','','0','10000','','0','1','','http://bjshenniao.zhifa.cc/uploadfile/2015/0326/20150326014226514.jpg','http://bjshenniao.zhifa.cc/uploadfile/2015/0326/20150326014232704.jpg','http://bjshenniao.zhifa.cc/uploadfile/2015/0326/20150326014239907.jpg','李小姐');
INSERT INTO `v9_fyal_data` VALUES('386','张先生数年前还着披着一头茂密乌黑的头发穿梭于大街小巷时，虽未引起明显的回头，但感觉清新自然。那时根本张先生就没有想过自己会有一天因为头发而如此烦恼。也许真的是失去后才懂得珍惜，这几年张先生对着镜子看着自己的前额逐渐上移、头发渐渐稀少时，才懊悔不已。张先生&ldquo;头发的离去，是风的追求?还是头皮的不挽留?&rdquo;<br />\r\n<br />\r\n自从发现自己头发已经开始脱落，张先生就四处求医，想尽一切办法来解决，可是所有的偏方、药物都试过了，头发仍然疯狂的脱落。当从网上了解到脱发严重的原因后，张先生不禁感慨：如果这些年早些注意，少熬夜、注意保养应该也不会出现这种情况。头发的悄然离去，让张新生悔恨有加，这些年我怎么就变成这样了呢？<br />\r\n<br />\r\n脱发确实是一件很郁闷的事，整体看起来感觉衰老、不健康。和朋友、同事在一起的时候，会多少损失了一些自信。<br />\r\n&nbsp;<br />\r\n为了挽救失落的心，张先生到处寻找治疗脱发的方法和医院，前前后后也用子许多药物，但效果并不明显。据张先生介绍说，是2010年8月的某一天，他突然在网站上收到了雍禾植发植发中心的网站上面还有一些植发前后对比的照片，不过&ldquo;植发&rdquo;这词着实吸引了张先生，后来张先生立刻利用网络搜索各种相关信息。那时才知道，植发手术确实是存在的。后来在家里、朋友的鼓励下张先生来到了雍禾植发植发中心做植发手术，张先生植发一共移植1600毛囊单位。植发手术半年多过去了，张先生长出了浓密的头发，看上去十分自然。<br />\r\n','0','','0','10000','','0','1','','http://bjshenniao.zhifa.cc/uploadfile/2015/0326/20150326014750940.jpg','http://bjshenniao.zhifa.cc/uploadfile/2015/0326/20150326014757349.jpg','http://bjshenniao.zhifa.cc/uploadfile/2015/0326/20150326014803195.jpg','张先生');
INSERT INTO `v9_fyal_data` VALUES('387','我是一名刚上大学的学生，在别人眼中，我的大好前程刚刚开始，美好的大学校园生活也即将展开，可是在风光的大学生活，却让我高兴不起来。因为我天天都要带着假发混日子，想到大学和同学一个宿舍，就有点烦恼，更难以想象到时如果真的他们拿着我的假发开玩笑，我该怎么办？<br />\r\n<br />\r\n小时候不小心从屋顶摔了下来，脑袋上磕了一个很大的疤，当时的疼痛已经忘记，不过那个疤却一直留了下来，因为这个疤，头发在这个地方就从此绝迹了，看着别人的头上郁郁葱葱，我真的很少羡慕，不过又能怎样呢？当时能捡回一条命已经算是很幸运了。<br />\r\n<br />\r\n从小我就和帽子相伴，妈妈给我买了很多顶很漂亮的帽子，不过帽子有时候也很难看，有时候我真的很想直接将帽子全部扔了，可是为了避免别人异样的眼光我最后还是选择了沉默，一直到我长大我就开始了自己与假发一起的日子，刚开始只能买很便宜的假发，哪种假发的质量很差劲，有时候甚至会掉头发，而且假发很不方便，在夏天会很闷热，而且一般假发都会有一定的长度，自己每天不得不顶个香菇头。<br />\r\n<br />\r\n假发其实并没有那么方便，刮风的时候怕风太大把假发给吹跑了，人多的时候又怕不小心被挤掉了，假发真的是让我每天提心吊胆，有时候梦中还会经常噩梦连连的发现自己的假发不知到哪里去了，四处寻找也找不到，很多次就这样在梦中惊醒。<br />\r\n&nbsp;<br />\r\n由于自己头顶上的疤，我就一直生活在一种不安之中，其实我不是没有女孩子喜欢，只是我不知道怎样向她说我其实是个秃子，就这样一直到见了一个朋友在雍禾植发做了植发手术，我想这个方法大概&nbsp;可以帮助我实现结束假发的困扰，于是我在网上咨询了他们的专家，原来疤痕上也可以进行植发，我的头发有救了，在经过半年的时间，我的头发长齐了，我也彻底的摆脱了假发的困扰。记得第一次摘掉假发走进宿舍的时候，我的那些兄弟室友们&ldquo;小磊，你这个新发型真帅！&rdquo;&nbsp;<br />\r\n','0','','0','10000','','0','1','','http://bjshenniao.zhifa.cc/uploadfile/2015/0326/20150326015150102.jpg','http://bjshenniao.zhifa.cc/uploadfile/2015/0326/20150326015156737.jpg','http://bjshenniao.zhifa.cc/uploadfile/2015/0326/20150326015202152.jpg','王磊');
INSERT INTO `v9_fyal_data` VALUES('388','我是客户部总监，经常在外和我们公司的客户洽谈，形象是给人的第一印象，特别的重要。以前我不管多忙也要刮胡子，因为胡子一旦长出来，不仅没型、凌乱，还显得颓废脏兮兮的，总是给忙碌的工作和生活带来多重困扰。常常看男人装这些时尚杂志，看人家模特的胡子型真是羡慕不已，真的很man，其实在心里就一直想做胡须移植手术。<br />\r\n<br />\r\n去年公司年会恰巧遇到了以前的合作伙伴。哇，他看起来比以前看上去稚嫩的形象真是不一样了，特有男人的那股味道。和他谈话中我得知他进行了胡须移植手术很成功。现在的气质和形象都有赖于好的手术医生的技术和设计。<br />\r\n<br />\r\n于是，在他的推荐下，我来到了雍禾植发，带着新奇的心情和对胡须的渴望，我仔细咨询了这里的植发专家，她们也很耐心的给我一一解答。此时此刻，我将所以的依赖和信任都交给了雍禾植发。<br />\r\n<br />\r\n植发专家对我的脸型和毛发质量进行了全面综合的考虑和检测后，为我设计了一款我很满意的胡须造型，让我对着镜子看是否满意。当时只是画出来的痕迹，我说现在具体还看不出来，就按这个胡须造型种植就行。在征得我的同意后，才开始进行手术，整个过程一点痛苦没有，几周后我蓄起了胡须，不仅服帖整齐，还很有型!现在工作交流，给别人留下的印象十分好。我自己也信心十足有面子。<br />\r\n<br />\r\n如今摸着自己满意的胡须，不得不感慨当初做的这个决定，一点都不后悔。<br />\r\n','0','','0','10000','','0','1','','http://bjshenniao.zhifa.cc/uploadfile/2015/0326/20150326015409973.jpg','http://bjshenniao.zhifa.cc/uploadfile/2015/0326/20150326015414788.jpg','http://bjshenniao.zhifa.cc/uploadfile/2015/0326/20150326015420326.jpg','陈先生');
INSERT INTO `v9_fyal_data` VALUES('389','我今年27岁，刚刚大学毕业不到两年，在校时是一名优秀的学生，毕业后便顺利的进入一家知名度很高的大企业工作。但是工作期间却面临诸多尴尬。因为我是一位先天性鬓角缺失患者，导致原本凸起的颧骨更加的凸显，严重影响了面部的整体美感。虽然这不是什么大病，但非常重影响面部轮廓。公司有几次与客户谈判，经理都&quot;特意&quot;没有让我参加。<br />\r\n<br />\r\n我知道自己已经步入社会，不像在校园，什么都无所谓，整天把自己埋在图书馆，不怎么注意自己的外形。这次我对经理没有一点儿抱怨，问题出现在我自己身上，自己的问题就要自己解决。<br />\r\n<br />\r\n通过多方的了解和咨询，后来听说雍禾植发的植发技术项目包括鬓角种植，且效果很好，便利用周末的时间赶了过来。植发专家肯定的告诉我，我的鬓角完全可以种植，雍禾植发还让他们院里的人体美学设计师根据我的脸型和当前的鬓角状态为他进行了鬓角术前设计，设计中多次征求我个人的意见，制定了更系统的植发手术方案。最终植发专家采用FUE-APL2.0无痕植发技术为我进行植发，从毛囊提取、分离毛囊、种植毛囊，整个过程一气呵成，非常顺利。<br />\r\n<br />\r\n鬓角种植手术结束后，我也经常电话和医生沟通，一方面是咨询注意事项，一方面是向医生反映恢复情况。大概三个月左右，鬓角移植效果初显，移植的毛囊长出新头发，大概七个月时，效果完全显现。如今，我的鬓角缺失部位已经长出健康、自然的毛发。整个人看上去都神采奕奕的，周围朋友都夸我更加帅气有型了!<br />\r\n','0','','0','10000','','0','1','','http://bjshenniao.zhifa.cc/uploadfile/2015/0326/20150326015722947.jpg','http://bjshenniao.zhifa.cc/uploadfile/2015/0326/20150326015728221.jpg','http://bjshenniao.zhifa.cc/uploadfile/2015/0326/20150326015733106.jpg','孙先生');
INSERT INTO `v9_fyal_data` VALUES('390','最先知道女士美人尖这词是缘于一位大学同学，撸上她的留海长发，便能看见额上中部头发尖尖地突出，真如鸟喙。我的这位同学亦的确长得美，大大的眼睛，长长的睫毛，柳叶眉，俏鼻红唇，还有这美人尖，再加上柔柔的声音，男女都为之倾倒。于是，我在艳羡之余，便想：美人大抵都有这样一个美人尖，这尖也是万平从中的一点尖了，百里挑一。放眼望去，一眼明晰美女所在，便如在众里寻她千百度，蓦然回首的一刹那的意境。<br />\r\n<br />\r\n标准的美女是不能没有美人尖的，尤其是夏天，当你把刘海后梳，露出光滑的额头时，过于平整的发际线，会使整个人显得没有生气，缺乏立体感。而美人尖，就是很好的&ldquo;破除&rdquo;单调发际线的点睛之笔。<br />\r\n<br />\r\n毕业以后工作了，如今身边美女如云，甚是羡慕，为了将自己打造成美女我也从各方面开始着手。一次听朋友说可以种植美人尖，心里痒痒的，工作几年了也稍有积蓄,为自己的塑美行动开始准备。听朋友推荐雍禾植发FUE-APL2.0是一项国际流行的毛发移植项目。雍禾植发医生会帮你在发际线中部，按照黄金比例和&ldquo;三庭五眼&rdquo;种出一个小小的三角，瞬间提升额头乃至整个面部的立体感，使人充满生气，让那些没有美人尖的&ldquo;准美女&rdquo;们，迅速拥有属于自己的美人尖。<br />\r\n<br />\r\n到了雍禾植发以后，才知道FUE-APL2.0无痕毛发移植，是一种通过精细设备从供体区（比如脑后枕部等）取得毛囊，应用精密种植器械进行无痕种植的最新方法，是目前世界上对毛囊伤害最小的毛发移植手术。经过医生的详细介绍，结合我自己的脸型、我选择了适合自己的美人尖，医生提前在额头画出你想要的美人尖效果，再在种植区域进行种植，没想到手术一切如此顺利。<br />\r\n','0','','0','10000','','0','1','','http://bjshenniao.zhifa.cc/uploadfile/2015/0326/20150326021217573.jpg','http://bjshenniao.zhifa.cc/uploadfile/2015/0326/20150326021222402.jpg','http://bjshenniao.zhifa.cc/uploadfile/2015/0326/20150326021227624.jpg','胡小姐');
INSERT INTO `v9_fyal_data` VALUES('391','上海的刘女士在当地一家星级酒店担任大堂经理，自从懂得辨别美丑之后，她从未扎过辫子，不管留短发还是留长发，她都喜欢用长长的刘海挡住自己那略显空旷的额头。为何刘女士从不梳马尾呢？原来她是属于那种天生发际线比较高的人。<br />\r\n<br />\r\n　　然而有一天风云突变，酒店来了一副喜欢较真的李总，在看到刘女士之后立刻就皱起了眉头。<br />\r\n<br />\r\n　　&ldquo;李总说我的样子看起来一点也不够职业，不像大堂经理，倒像个酒吧里驻唱的。说真的，当时我一听他这么说，差点儿就哭出来了！&rdquo;刘女士回忆说，由于新来的李总要求留长头发的女性员工需要将自己的头发扎起来系在脑后，否则就要扣工资扣奖金，所以当时她非常的纠结。<br />\r\n<br />\r\n　　一方面，她舍不得留了好多年的长头发，另一方面，她又舍不得薪水不菲的工作。想保留头发，就要面临被扣工资扣奖金的局面，那样不但会损失钱财，还会很丢人，因为所有被扣钱的员工是会被通报批评的，想避免这种情况，要么按要求把头发扎起来，要么直接剪成短发，要么&hellip;&hellip;就辞职走人。<br />\r\n<br />\r\n　　刘女士发际线移植术前刘女士对着镜子犹豫了好长时间，由于发际线太高，一把头发扎起来就会显得她怪怪的。最后几经挣扎，她还是妥协了，把头发扎成马尾辫然后去上班。到了酒店之后，能一眼认出她来的同事一只手就能数得过来，绝大部分同事看到她之后都以为是陌生人。等大家认出她来之后，纷纷拿她的额头开起了玩笑，这让她感到非常受伤。<br />\r\n<br />\r\n如此过了一周的时间，刘女士终于忍无可忍，生出了辞职的心思。就在这个时候，一次无意间听朋友说谁做植发手术了，刘女士就开始上网查询自己的情况是否可以改善。没想到通过网络咨询后发现，自己这种属于发际线过高是可以调整的。刘女士着手准备挑选一家值得信赖的医院做植发手术。多家对比选择，发现雍禾植发无论是论坛、贴吧都有发友再说不错，她决定一试。<br />\r\n<br />\r\n&nbsp;没想到自从自己预约手术之后，刘女士一切都很顺利，到诊安排、术前检查、发际线设计等医生护士都耐心的进行解答和沟通。在良好地沟通之后，雍禾植发专家给刘女士采用了FUE-APL2.0无痕植发技术，术后刘女士听从医生安排做好护理，半年后头发就长出来，如今自己再也不怕露额头了，真心很开心！<br />\r\n','0','','0','10000','','0','1','','','','','刘女士');
